import React from 'react';
import Particles from 'react-particles-js';

export default function ParticlesComponent() {
    return (
        <Particles
        params={{
            "particles": {
                "number": {
                    "value": 50
                },
                "size": {
                    "value": 3
                }
            },
            "interactivity": {
                "events": {
                    "onhover": {
                        "enable": true,
                        "mode": "repulse"
                    }
                }
            }
        }
    }
             />


    )
}
